import React, {useState} from 'react'

import {Wrapper} from '../components/Styled';
import LebenslaufItem from '../components/LebenslaufItem';

import styled from "styled-components";

const Container = styled(Wrapper)`
    justify-content:center;
    align-items:center;
`
const Item = styled.div`
    height:3em;
    width:100%;
    max-width:30em;
    background-color:var(--p-3);
`

export default function Lebenslauf() {
    const [active, setActive] = useState(1);


    return (
        <Container>
            <LebenslaufItem expand={true} onClick={(e) => setActive(1)}/>
            <LebenslaufItem expand={2 === active} onClick={(e) => setActive(2)}/>
            <LebenslaufItem expand={3 === active} onClick={(e) => setActive(3)}/>
        </Container>
    )
}
